Добро пожаловать на канал!
У нас Вы увидите:
1. Видео по теме: КАК ЭТО БЫЛО НА САМОМ ДЕЛЕ (КЭБНД) - расследование катастроф;
2. Видео-подкасты и видео-Блоги по Вашим заказам; 
3. Видео по теме: \

► Spark your curiosity!

Welcome on the DIY Experiments channel. Whether you’re science lovers, students or curious tinkerers, we hope you’ll appreciate our videos ;)
We’re Armand and Victor, twin brothers currently enrolled in an engineering school. We are passionate about many things, the first one being energy and, more precisely, electricity.

Now, for a quick summary of the upcoming videos, we’ll show you how to:

• build a coil gun that can shoot nails;
• make an inverter;
• transmit a music signal with LASER;
• create hydrogen using water electrolysis;
• make some electric arcs;
• make electricity with a flame;
• create a flash stroboscope;
• make an induction forge;
• transfer electricity without wires;
• make a lot of electricity using a bicycle;
• make a wind turbine;
• make a homemade e-scooter

And many, many other cool stuff!

Thanks for your interest and have fun watching!

Perimeter Institute is a leading centre for scientific research, training, and educational outreach in foundational theoretical physics. Founded in 1999 in Waterloo, Ontario, Canada, its mission is to advance our understanding of the universe at the most fundamental level, stimulating the breakthroughs that could transform our future. Perimeter also trains the next generation of physicists through innovative programs, and shares the excitement and wonder of science with students, teachers, and the general public.

www.perimeterinstitute.ca
@Perimeter

Привет, друзья.  С вами военный журналист и фотограф Константин Лазарев. 
На канале LAZAREV TACTICAL я покажу вам самое современное оружие и специальные разработки, расскажу о тактическом снаряжении, которое протестировал лично и познакомлю с миром СПЕЦНАЗА! 

Тематика канала: 
- Стрелковое оружие, специальные образцы (пистолеты, автоматы, пулеметы, гранатометы и прочее);
- Тактическое снаряжение (шлемы, бронежилеты, разгрузки, форма, обувь и прочее );
- Спецподраздлеления (ЦСН ФСБ, Альфа, Вымпел, Витязь, СОБР); 
- Учения, соревнования и выставки (оружие и снаряжение, связь, медицина, военная техника);
- Военная техника (танки, бронемашины, авиация, артиллерия);

Подписывайтесь на канал, ставьте лайки и следите за новостями!

